import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import axios from 'axios'

const AuntifactionPageCallback = () => {
	const navigate = useNavigate()
	useEffect(() => {
		const authorizationCode = new URLSearchParams(window.location.search).get(
			'code'
		)

		const fetch = async authorizationCode => {
			axios.interceptors.response.use(
				response => response,
				error => {
					console.error('Axios Error:', error)
					return Promise.reject(error)
				}
			)
			const response = await axios.get('http://localhost:3003/api/data', {
				params: {
					authorizationCode: authorizationCode,
					redirectUrl: 'http://localhost:3000/auntification',
				},
			})
			navigate('/menu', {
				state: response.data,
			})
		}
		if (authorizationCode) {
			fetch(authorizationCode)
		} else {
			navigate('/error')
		}
	}, [navigate])
	return <div></div>
}

export default AuntifactionPageCallback
